    an earmarked contribution to Dingell for Congress from Edward Fritts.  Mr. Fritts
    contributed to the PAC on May 11, 2010 during a previous reporting period, but
    made the request for a portion of his contribution to be earmarked for Dingell
    for Congress on September 16, 2010.  Based on advice from Campaign Finance Analyst
    Nicole Miller on October 15, 2010, the corresponding receipt for the disbursement
    disclosed on Schedule B was previously reported so the PAC is noting the date
    of the original receipt and the date of the earmark.  Further the PAC is showing
    that the disbursement to Dingell for Congress counted toward both the PAC and
    individual's contribution limits.  The PAC requested a refund from Dingell for
    Congress for this disbursement on October 14, 2010.  \n"
